window.bookSummaryJSON = "<p><b>Elaine and Iona continue to attend the School of Sorcery and Spellcraft, working on their classes and Classes, learning the secrets of the world, and receiving divine quests.</b></p> <p>Iona discovers that the Valkyries have been uprooted, the Order being slowly smothered by political enemies who want their riches for themselves. She's in no position to take out the entrenched power structures, but can she humiliate Rolland on the world stage?</p> <p>Elaine's Medical Manuscripts have spread and grown far beyond what she could've ever imagined. Proving that she's the creator and getting credit for her work is going to be more than a little difficult.</p> <p>Looming over both of them is graduation and questions. Where will they go after they graduate? What will they do? What plans do Selene and Lunaris, twin Goddesses of the Moons, have for them?</p>"; 
